  providedIn: 'root'
})
export class ClientesService {

  constructor(  ) { }

  getCliente() : Cliente {
      let cliente : Cliente = new Cliente();
      cliente.nome = "Henrique Camargo";
      cliente.cpf = "52463553812";
      return cliente;
    }
  }
